uploadtext:
Файлатнень тонгомга тевс нолдык те форманть. Икеле тонгозь файлатнень ванномга эли муемга пшкадть [[Special:FileList|тонгозь файлань спискас]]. Тонгоматне ды одов тонгоматне тешкставить [[Special:Log/upload|тонгомань журналсо]]. 
Нардазь файлатнеде весемесь муеви [[Special:Log/delete|нардамонь журналсо]].

Сёрмадовксос файланть путомга тевс нолдак невтема истят ёнкстнэнь ютксто:
* <strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.jpg]]</nowiki></code></strong> файлань покш версиянть тевс нолдамга;
** <strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.png|200px|thumb|left|Caption]]</nowiki></code></strong> текстэнть эйстэ керш ёндо невтевксэнь 200 пикселень келейгадомасо алонзо сёрмадома марто путомга;
* <strong><code><nowiki>[[</nowiki>{{ns:media}}<nowiki>:File.ogg]]</nowiki></code></strong> файлантень виде совамсто ванномга.

